import heapq
from collections import defaultdict
from typing import List


class MaximumNumberOfEatenApples:

    def eatenApples(self, apples: List[int], days: List[int]) -> int:
        pq = []
        N = len(apples)
        for i in range(N):
            if apples[i]==0 and days[i]==0:
                continue
            heapq.heappush(pq, (i + days[i], apples[i], i+1))

        count = 0
        day = 1
        while pq:
            while pq and pq[0][0] < day:
                heapq.heappop(pq)
            if not pq:
                break
            day += 1
            count += 1
            pqdays, pqapp,d = heapq.heappop(pq)
            if pqapp>1:
                heapq.heappush(pq, (pqdays, pqapp - 1, d))
        return min(sum(apples), count)

